class CameraWidget extends StatefulWidget {
  final String url;
  final Offset position;
  final Size size;
  final bool isMini;
  final Function switchCamera;

  const CameraWidget({
    Key key,
    this.url,
    this.isMini,
    this.switchCamera,
    @required this.position,
    @required this.size,
  }) : super(key: key);

  @override
  _CameraWidgetState createState() {
    return _CameraWidgetState();
  }
}

class _CameraWidgetState extends State<CameraWidget> {
  String cachedURL;
  Timer _connectionTimer;

  @override
  void initState() {
    cachedURL = widget.url;

    super.initState();
  }

  @override
  void didUpdateWidget(covariant CameraWidget oldWidget) {
    cachedURL = widget.url;
    super.didUpdateWidget(oldWidget);
  }

  @override
  Widget build(BuildContext context) {
    return Positioned(
        left: widget.position.dx,
        top: widget.position.dy,
        child: StreamBuilder(
          stream: mqttHelper.dataReceived,
          builder: (context, snapshot) {
            if (snapshot.hasData &&
                snapshot.data is Map<String, dynamic> == true) {
              var data = snapshot.data as Map<String, dynamic>;
              if (data.containsKey(cachedURL)) {
                return _getParentContainer(data[cachedURL]);
              } else {
                return Center(child: CircularProgressIndicator());
              }
            } else {
              return Center(child: CircularProgressIndicator());
            }
          },
        ));
  }

  @override
  void dispose() {
    super.dispose();
  }

  Widget _getParentContainer(Uint8List imageData) {
    if (widget.isMini != null && widget.isMini == true) {
      return Column(
        children: [
          Container(
            width: widget.size.width,
            height: widget.size.height,
            decoration: BoxDecoration(
                border: Border.all(
                    color: CoreStyle.operationGreenBorderColor, width: 5.w),
                borderRadius: BorderRadius.circular(17),
                boxShadow: [
                  BoxShadow(
                      blurRadius: 40.r,
                      offset: Offset(0, 10.h),
                      color: CoreStyle.operationShadowColor)
                ]),
            child: ClipRRect(
              borderRadius: BorderRadius.circular(17),
              child: Stack(
                children: <Widget>[
                  SizedBox.expand(
                    child: FittedBox(
                      fit: BoxFit.cover,
                      child: Image.memory(
                        imageData,
                        gaplessPlayback: true,
                        width: widget.size.width,
                        height: widget.size.height,
                      ),
                    ),
                  ),
                  //FURTHER IMPLEMENTATION
                ],
              ),
            ),
          ),

        ],
      );
    } else {
      return Container(
        child: Stack(
          children: <Widget>[
            SizedBox.expand(
              child: FittedBox(
                fit: BoxFit.cover,
                child: Image.memory(
                  imageData,
                  gaplessPlayback: true,
                  fit: BoxFit.cover,
                  width: widget.size.width,
                  height: widget.size.height,
                ),
              ),
            ),
            //FURTHER IMPLEMENTATION
          ],
        ),
        width: widget.size.width,
        height: widget.size.height,
      );
    }
  }
}

